import React, {useState} from 'react'

function HookCounterFour() {
    const [items, setItems] = useState([])

    const addbutton = () => {
        setItems([...items, {
            id: items.key,
            
        }])
    }

  return (
    <div>
        <button onClick = {addbutton}>Add a button</button>
        <ul>
            {items.map(items => (
                <li key = {items.key}>{items.value}</li>
            ))
            }
        </ul>
    </div>
  )
}

export default HookCounterFour
